description:
The Art of Control (Disanto, Daring ! / **NEW** / 2014)

Stella always had a secret attraction to all things kinky.
Her mind was constantly full of dark, sexual imagery.
She put it down to pure fantasy until she became involved in a relationship with an older, dominant lover.
Stella was about to be introduced to an underground world of kinky fetish games, where she could
live out her sexual desires as she became a willing student in The Art of Control.

Anton Gilder, Ben Kelly, Chessie Kay, Dean Van Damme, Jaiden West, Kerry Louise, Lexi Lowe, Marc Rose, Stella Cox

